const regex = /https?:\/\/(www\.)?mediafire\.com\/[^\s]+/g;

document.querySelectorAll('a').forEach(link => {
    const href = link.getAttribute('href');
    if (href) {
        // Tìm phần sau 'urls=' trong href
        const urlParam = new URLSearchParams(href.split('?')[1]).get('urls');
        if (urlParam && regex.test(urlParam)) {
            // Mở link trong tab mới
            window.open(urlParam, '_blank');
        }
    }
});

